import React, { useState } from 'react';
import data from './data.json';
import { Heading } from '../Heading/Heading';
import { Text } from '../Text/Text';

export const Departments = () => {
  const [DepartmentJson, getDepartmentJson] = useState(data);
  return (
    <div>
      <Heading>Departments</Heading>
      <div>
        {DepartmentJson.map((element, index) => (
          <div>
              <table>
                <thead>
                  <tr>
                    <th>Department Name</th>
                    <th>Description</th>
                    <th>Openings</th>
                  </tr>
                </thead>
                <tbody>
                  <td>{element.Title}</td>
                  <td>{element.Description}</td>
                  <td>{element.Openings}</td>
                </tbody>
                </table>
            {/* <Text>Department Title: </Text>
            <Text>Organisation Id: {element.OrgId}</Text>
            <Text>Description: {element.Description}</Text> */}
          </div>
        ))}
      </div>
    </div>
  )
}
